import { useNavigate } from "react-router-dom";
import weddingImage from "../styles/images/brave2.jpeg";

const Contentt = () => {
  const navigate = useNavigate();
  return (
    <div className="content container">
      <div className="judul">
        <img src={weddingImage} alt="" />
        <h1>Contentt</h1>
        <button className="kembali" onClick={() => navigate("/")}>
          Cover
        </button>
        <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Aspernatur, eos? Quae sint sit voluptas dolore placeat eveniet dolores fugiat magni. Voluptate, quos? Accusamus quas inventore aliquam adipisci veniam aliquid earum.</p>
      </div>
    </div>
  );
};

export default Contentt;
